            function generateHeatmap(matrix, tokens) {
                const heatmap = document.getElementById('heatmap');
                const numRows = matrix.length;
                const numCols = matrix[0].length;

                // 添加列标题
                let header = heatmap.insertRow();
                header.insertCell(); // 空单元格
                for (let j = 0; j < numCols; j++) {
                    let cell = header.insertCell();
                    cell.innerHTML = tokens[j];
                }

                // 填充矩阵
                for (let i = 0; i < numRows; i++) {
                    let row = heatmap.insertRow();
                    let headerCell = row.insertCell();
                    headerCell.innerHTML = tokens[i]; // 行标题

                    for (let j = 0; j < numCols; j++) {
                        let cell = row.insertCell();
                        cell.style.backgroundColor = `rgba(255, 0, 0, ${matrix[i][j]})`; // 红色热力图
                        cell.innerHTML = matrix[i][j].toFixed(2);
                    }
                }
            }

            generateHeatmap(matrix, tokens);
        </script>
